    CREATE_OR_UPDATE_TASK: "\n\t\tmutation createTicket(\n\t\t\t$active: Boolean\n\t\t\t$assignedBy: ID\n\t\t\t$assignedTo: ID\n\t\t\t$category: String\n\t\t\t$customFields: [FieldInput]\n\t\t\t$department: ID\n\t\t\t$description: String\n\t\t\t$dueDate: DateTime\n\t\t\t$email: String\n\t\t\t$firstName: String\n\t\t\t$guestId: Int\n\t\t\t$issueType: Int\n\t\t\t$lastName: String\n\t\t\t$phone: String\n\t\t\t$priority: String\n\t\t\t$propertyId: String\n\t\t\t$source: String\n\t\t\t$status: String\n\t\t\t$taskType: String\n\t\t\t$ticketIds: [ID]\n\t\t\t$title: String\n\t\t\t$watchers: [ID]\n\t\t) {\n\t\t\tdata: createTicket(\n\t\t\t\tactive: $active\n\t\t\t\tassignedBy: $assignedBy\n\t\t\t\tassignedTo: $assignedTo\n\t\t\t\tcategory: $category\n\t\t\t\tcustomFields: $customFields\n\t\t\t\tdepartment: $department\n\t\t\t\tdescription: $description\n\t\t\t\tdueDate: $dueDate\n\t\t\t\temail: $email\n\t\t\t\tfirstName: $firstName\n\t\t\t\tguestId: $guestId\n\t\t\t\tissueType: $issueType\n\t\t\t\tlastName: $lastName\n\t\t\t\tphone: $phone\n\t\t\t\tpriority: $priority\n\t\t\t\tpropertyId: $propertyId\n\t\t\t\tsource: $source\n\t\t\t\tstatus: $status\n\t\t\t\ttaskType: $taskType\n\t\t\t\tticketIds: $ticketIds\n\t\t\t\ttitle: $title\n\t\t\t\twatchers: $watchers\n\t\t\t) {\n\t\t\t\tstatus\n\t\t\t\tticket {\n\t\t\t\t\t".concat(_fragment.default.TICKET_FRAGMENT, "\n\t\t\t\t}\n\t\t\t}\n\t\t}\n\t"),
